import React from "react-dom";
import "./Home.css";
import NavBar from "./NavBar";
import Trades from "./Trades";

function Home() {

    return (
        <div className="home">
            <NavBar />

            <main className="main">
            <Trades />    

            </main>
        </div>
    );
}

export default Home;
